import React from 'react';
import ReactDOM from 'react-dom';
import Button from 'react-bootstrap/Button';
import './log_in.css' ;

class LogIn extends React.Component{

  render(){
    return(
    <div>
      <Button className="button2" variant="primary" size="lg">
      <b>Log in</b>
      </Button>
    </div>
    )
  }
}
export default LogIn;
